【描述】 跳过与指定模式匹配的格式化文件和目录。 模式格式与 .gitignore 相同。 一定要使用 Unix/forwardslash/style 路径，此路径样式适用于所有平台。 不支持带有反斜杠 \ 的 Windows 样式路径。 【对应配置项】 对应选项 可选值 是否 stable 说明 ignore 格式化每一个Rust文件（默认） No 指定文件或目录跳过格式化 【示例】 // 跳过指定文件
ignore = [ "src/types.rs", "src/foo/bar.rs",
]
// 跳过指定目录
ignore = [ "examples",
]
// 跳过项目内所有文件
ignore = ["/"]

