77.body:
函数 【正例】 fn lorem() { // 花括号和fn定义在同一行 // body
} fn lorem(ipsum: usize) { // 花括号和fn定义在同一行 // body
} // 当有 `where` 子句的时候，花括号换行
// 并且，`where` 子句和 `where` 关键字不在同一行
fn lorem<T>(ipsum: T)
where T: Add + Sub + Mul + Div,
{ // body
} 通过配置 where_single_line 为 true，方可设置 where子句在同一行，如下： // 当有 `where` 子句的时候，花括号换行
// 设置了 `where_single_line=true` ，则`where` 子句和 `where` 关键字在同一行
fn lorem<T>(ipsum: T)
where T: Add + Sub + Mul + Div,
{ // body
} 【反例】 如果设置 brace_style = "AlwaysNextLine"，则： fn lorem()
{ // body
} fn lorem(ipsum: usize)
{ // body
} fn lorem<T>(ipsum: T)
where T: Add + Sub + Mul + Div,
{ // body
} 如果设置 brace_style = "PreferSameLine"，则： fn lorem() { // body
} fn lorem(ipsum: usize) { // body
} fn lorem<T>(ipsum: T)
where T: Add + Sub + Mul + Div, { // 注意这里和 `SameLineWhere`的区别 // body
} 结构体与枚举 【正例】 struct Lorem { ipsum: bool,
} struct Dolor<T>
where T: Eq,
{ sit: T,
} 【反例】 如果设置 brace_style = "AlwaysNextLine"，则： struct Lorem
{ ipsum: bool,
} struct Dolor<T>
where T: Eq,
{ sit: T,
} 如果设置 brace_style = "PreferSameLine"，则： struct Lorem { ipsum: bool,
} struct Dolor<T>
where T: Eq, { sit: T,
} 流程控制 流程控制倾向于默认使用 AlwaysSameLine，即，总在同一行。因为流程控制没有where子句。 【正例】 // "AlwaysSameLine" (default)
fn main() { if lorem { println!("ipsum!"); } else { println!("dolor!"); }
} 【反例】 如果设置 brace_style = "AlwaysNextLine"，则： fn main() { if lorem { println!("ipsum!"); } else { println!("dolor!"); }
} 如果设置 brace_style = "ClosingNextLine"，则： fn main() { if lorem { println!("ipsum!"); } // 注意这里 if 分支结尾处，else 换行 else { println!("dolor!"); }
}

